import Prismic from '@prismicio/client';

export function getPrismicClient(req) {
  console.log('teste');
  const prismic = Prismic.client(process.env.PRISMIC_API_ENDPONT, {
    req,
    accessToken: process.env.PRISMIC_ACCESS_TOKEN,
  });

  return prismic;
}
